import React from 'react'

import { Component } from 'react'

class Nav extends Component {
    render() {
        return(
            <nav className='nav-wraper black' >
               <div className='conatiner' >
                   <a>UBISOFT</a>

                   <ul className='right' >
                        <li>Home</li>
                        <li className='btn-floating indigo darken-4 z-depth-0' >amk</li>
                   </ul>
               </div>
            </nav>


        )
    }
}

export default Nav
